import React from 'react';
import Nav from './Nav';
import Rahima from './Rahima';
import Sabrina from './Sabrina';
import Wietske from './Wietske';
import Storm from './Strom';
import './App.css';

function App() {
  return (
    <div>
     <Nav />
     <Rahima />
     <Sandra />
     <Wietske />
     <Storm />
    </div>
  );
}

export default App;
